    /* PORTA_DFWR: FILT=0 */
    PORTA_DFWR &= (uint32_t)~(uint32_t)(PORT_DFWR_FILT(0x1F)); 
    
    /* GPIOA_PSOR: PTSO&=~0x1000 */
